Write a program that counts the lines of a text file containing the phrase FAUST:. 1 - We first build a functional version: // Interface
class Operator {
public: virtual char const* getNextString() = 0;
}; // Read an array one time
class ArrayReader : public Operator {
private: char const* inputArray; bool isRead{false}; public: ArrayReader(char const* array) : inputArray(array) {} char const* getNextString() override { if (isRead) { return nullptr; } isRead = true; return inputArray; }
}; class LineSeparator : public Operator {
private: Operator&& input; char const* currentString{nullptr}; public: LineSeparator(Operator&& input) : input(std::move(input)) {} char const* getNextString() override { if (currentString == nullptr) { currentString = input.getNextString(); } auto result = currentString; // Advance until the next string for later calls if (currentString != nullptr) { while (*currentString != '\n' && *currentString != '\0') { currentString++; } if (*currentString == '\n') { currentString++; } else if (*currentString == '\0') { return nullptr; } } return result; }
}; class LineMatcher : public Operator {
private: Operator&& input; char const* currentString{nullptr}; public: LineMatcher(Operator&& input) : input(std::move(input)) {} char const* getNextString() override { auto candidate = input.getNextString(); while (candidate != nullptr) { // try to match with our target string if (candidate[0] == ' ' && candidate[1] == 'F' && ...) { return candidate; } candidate = input.getNextString(); } return nullptr; } }; class LineCounter {
private: Operator&& input;
public: LineCounter(Operator&& input) : input(std::move(input)) {} unsigned long getCount() { unsigned long count = 0; auto line = input.getNextString(); while (line != nullptr) { count++; line = input.getNextString(); } return result; }
}; int main(int argc, char *argv[]) { auto fd = open(argv[1], O_RDONLY); auto fsize = lseek(fd, 0, SEEK_END); lseek(fd, 0, SEEK_SET); auto data = (char*) mmap(nullptr, fsize, PROT_READ, MAP_SHARED, fd, 0); auto res = LineCounter( LineMatcher( LineSeparator( ArrayReader(data) ) ) ).getCount(); printf("Count: %lu\n", res); return 0;
} 2 - If we benchmark our program using time and compare with grep, we see that our program is x4 slower (for large file sizes). Now, we try to run the string matching on the main function directly by comparing the bytes, instead of using all of the classes and OOP-style code. 3 - We should also try to compile with -O3 optimisations, which gives us a good performance boost. 4 - We can improve the string matching loop by directly comparing an 8-byte word at a time: // Get the bit pattern of what we're looking for
long word = *((long *) " FAUST:"); for (auto i = 0; i < fsize - 9; i++) { long currWord = *((long*)(data + i); if (currWord == word && data[i+8] == '\n') { count++; }
} This gives us a x2 speed increase compared to grep. This is what performance engineering is about : we first meet the functional requirements and then optimise for performance. Performance engineering is about the techniques applied during a systems development life cycle to ensure the non-functional requirements for performance will be met.

