extern size_t N; // some large constant
extern size_t stride; // the parameter of our experiment int sum = 0;
for (size_t i = 0; i < N; i += stride) { sum += input[stride];
} The next step is to interpret the results of the microbenchmark. A common interpretation technique is interpolation, where we draw a graph based on the datapoints we collected. It is not usually very accurate, but it is easy for humans to understand. Advantages: Easy to get (if the system is available to run) Based on ground truth (this is actual measured behaviour) Easy to interpret Disadvantages: They generalise poorly (cannot easily be applied to new environments, such as more CPUs, more memory, etc.) Massive amounts of experimental data needed for high-dimensinal parameter spaces Limited accuracy and prediction confidence Limited interpretability (contributing factors are implicit)

