Let's model this benchmark, where we have random access into the array input2: extern int* input1; // uniform random data
extern int* input2; // random data int sum = 0;
for (size_t i = 0; i < inputSize; i++) { sum += input2[input1[i]];
} First, let us define parameters in terms of memory regions and access patterns (see section 3 of this paper ). The length of a memory region is \((R.n)\) (ie: the number of stored "elements") The width of a memory region is \((R.w)\) (ie: the size of the tuple/struct in words) The total size of the region \(||R||\) (ie: \(n \cdot w\)) The access pattern is \(u\) (ie: the distance between two accesses) In addition, we can model two types of access patterns: \(\text{Pattern 1} \oplus \text{Pattern 2}\) is the sequential execution of both access patterns. \(\text{Pattern 1} \odot \text{Pattern 2}\) is the interleaved execution of both access patterns (ie: doing two access in each iteration of a loop) If we suppose that input1 contains 1024 uniform random ints and input2 has 64 random ints, we can describe the access pattern in terms of an interleaved sequential traversal (into input1) and random access (into input2): \(s_{trav}(R.n = 1024, R.w = 1, u = 1) \odot rr_{acc}(R.n = 64, R.w = 1, u = 1, r = 1024)\) Here \(r\) represents the number of accesses. We have \(R.w = 1\) because we are storing integers (we assume integers are a word in size) and \(u = 1\) because our stride is 1 word. \(s_{trav}\) represents the sequential traversal while \(rr_{acc}\) represents the repetitive random access. We can do more interesting things, where input1 is struct: struct record {int a; int b; int c;};
extern record* input1; // uniform random data, 1024 values
extern int* input2; // random data, 64 values int sum = 0;
for (size_t i = 0; i < inputSize; i++) { sum += input2[input1[i].a];
} The access pattern description is: \(s_{trav}(R.n = 1024, R.w = 3, u = 1) \odot rr_{acc}( R.n = 64, R.w = 1, u = 1, r = 1024)\) From the paper, we support three different access patterns: Sequential traversal \(s_{trav}\) : a sequential sweep over all the values in R exactly once. Single random traversal \(r_{trav}\) : all elements are accessed exactly once but in a random order. Repetitive random access \(rr_{acc}\) : randomly accesses \(r\) values (may be hit more than once and some may not even be hit).

