Consider the following microbenchmark: extern int* input; // uniform random ints between 0 and 100 int sum = 0;
for (size_t i = 0; i < inputSize; i++) { if (input[i] > threshold) { sum += input[i]; }
} One of the factors contributing to the performance of this code is the branch misprediction rate . If threshold is set to 50, the branch predictor will be wrong more often than if it was set to <20 or >80 for example (because the data is random). We can model branch misprediction rate using a Markov chain: The branch predictor starts in any of the shown states, which represents the confidence of the branch predictor based on whether the branch is actually taken or not. We can calculate the probability of it being in any state as the stationary distribution . The branch misprediction rate is then given by: \(( P(pred_taken) \cdot P(act_not_taken) ) + ( P(pred_not_taken) \cdot P(act_taken) )\) As you can see from the expression above, the worst case scenario is when we are in a not taken state but the branch is actually taken, or when we are in a taken state but the branch is not actually taken. We can model branch predictors with more states if we want to keep a deeper history of past branches and potentially get more accurate branch predictions. Modeling can be useful because you can verify results that have been stated and you take for granted.

