An important consideration to improving CPU efficiency is to write runtime predictable code for the critical path. We should evaluate code as early as possible and outside of the critical path whenever possible. One technique is partial evaluation which consists of making the compiler work for you. We treat programs as multi-phased process. In every phase, you know more about the result so you can come up new programs that is more specialised tailored to the input. Examples are: Function inlining : the compiler evaluates a function jump and places the code at the call site. JiT compilation : we start with higher level bytecode and compile it into native machine code. Symbolic programming : perform arithmetic on symbols rather than values (eg: x/x will always be 1). Constant expression evaluation : evaluate constant expressions at compile-time. Example 1: constant evaluation int result(int input) { return input*3*5;
}; int result2(int input) { int three = 3-1; int five = 4+1; return input*three*five;
}; int three = 3;
int five = 5;
int result3(int input) { return input*three*five;
}; In result2(), the compiler figures out that variables three and five are always constant and replaces the operation with the values. In result3(), the C compiler does not perform constant evaluation because it sees that three and five are variables available to other parts of the code and may be modified. It is important to understand the language semantics to know what constitutes a constant. Example 2: lifting expensive operations Any work that is executed often (such as in a loop) can be moved/lifted into a section where it executed seldomly. This can reduce control-flow hazards, since they now only occur once per loop rather than per iteration. A typical example is loop invariant motion, where we move loop invariant operations outside of the loop: for (size_t i = 0; i < N; i++) output[i] = 7*8; becomes: int tmp = 7*8; for (size_t i = 0; i < N; i++) output[i] = tmp; A related problem is loop specialisation . Suppose we want to scale a vector: void scaleVector(int* input, size_t inputSize, int scale) { for(size_t i = 0; i < inputSize; i++) input[i] *= scale;
} The issue is that multiplications are quite expensive. Therefore, we can specialise the loop to avoid operations entirely (if scale == 1) or make them cheaper (use bit shifts). void scaleVector2(int* input, size_t inputSize) { if(scale != 1) { // avoid scale == 1 entirely if(scale == 2) (size_t i = 0; i < inputSize; i++) input[i] <<= 1; // use cheap bitshift for scale == 2 else (size_t i = 0; i < inputSize; i++) input[i] *= scale; }
} Unfortunately, this leads to code duplication. Instead, we can use metaprogramming to get the compiler to do the work for you. The idea here is to generate special cases at compile-time and apply optimisations for these cases. C++ supports template metaprogramming and allows us to turn this... void scaleVector(int* input, size_t inputSize, int scale) { for(size_t i = 0; i < inputSize; i++) input[i] *= scale;
}; int useIt(int* input, size_t size) { scaleVector(input, size, 2); scaleVector(input, size, 1); scaleVector(input, size, 0);
} into this... template <int scale> void scaleVectorPE(int* input, size_t inputSize) { for(size_t i = 0; i < inputSize; i++) input[i] *= scale;
}; int useIt(int* input, size_t size) { scaleVectorPE<2>(input, size); scaleVectorPE<1>(input, size); scaleVectorPE<0>(input, size);
} Because the scale factor is known at compile-time, the compiler will be able to replace a multiplication by 2 with a bitshift, ignore the scale of 1 and set the input to 0 directly in the third case. A useful pattern is to create a map that holds precomputed special cases for certain inputs. If the input is defined in the map, the precomputed result is obtained. Otherwise, we can resort to our runtime version of the function. Example 3: branch-free code We can go even further by writing branch-free code. We have seen how control-dependencies can cause hazards, such as below: for(size_t i = 0; i < inputSize; i++) if(input[i] < high) output[outI++] = input[i]; We can be clever and manipulate how the ouputI index changes: for(size_t i = 0; i < inputSize; i++) output[outI] = input[i]; outI += (size_t) (input[i] < high); We are now writing everything to the output array however we only move onto the next case if the condition holds. If it does not hold, outI does not change and the next value will overwrite the previous value (which is fine). In fact, this is beneficial for cache locality! We can see the performance impact compared to the previous snippet (for a random array): We've converted this control dependency into a data dependency, so we need to be careful. If we find that branch missprediction is causing a problem, if-conversion is a good idea. Otherwise, it's probably not worth it (a lot of code is already very predictable, the case above is randomised). The bottom-line is: measure, then optimise! Example 4: SIMD vectorisation Compilers try to automatically vectorise your code. For a simple case like below... for (size_t i = 0; i < 1024; i++) out[i] = in1[i] * in2[i]; ...the compiler will succeed. However, for more complicated cases we need to explicitly vectorise our code using intrinsics. Lets see an example below: #include <immintrin.h> union v8f { // either a float[8] or a SIMD word float floats[8]; __m256 simdVec;
}; auto input1 = new int[bounds1]; // random data
auto input2 = new int[bounds2]; // random data // Non-vectorised sum:
float sum = 0;
for (size_t i = 0; i < bounds1; i++) sum += input2[input1[i]] // Vectorised sum:
v8f sums{};
for (size_t i = 0; i < bounds1 / 8; i++) { v8f values { // load values from memory using gather .simdVec = _mm256_i32gather_ps(input2, ((__m256i*)input1)[i], sizeof(int)) }; // perform addition directly on the simd register sums.simdVec = _mm256_add_ps(values.simdVec, sums.simdVec);
}
float sum = 0;
for (size_t i = 0; i < 8; i++) sum += values.floats[i]; In the vectorised version, we obtain a x5 performance improvement than the scalar version. It is crucial that we keep our data in SIMD registers, otherwise we don't get the same benefits.

