Generally, the number of data-hazards (cache misses) when running a loop will be: \(\frac{\text{data size}}{\text{cache line size}}\) Luckily, CPUs support hardware prefetching whereby caches speculatively load the next cache line by recognising patterns and strides. This works well for regular memory accesses, but may break for irregular accesses like data-dependent accesses. struct tuple { int x; int y; int z;};
int sumIt(tuple* input, long size, tuple* input2) { int sum = 0; for(size_t i = 0; i < size; i++) sum += input2[input[i].x].y; return sum;
} In the example above, the CPU knows the next cache line to be accessed for indexing into input[i] because it is a simple strided-accesses, however the index into input2 is data-dependent. We can help the CPU through software prefetching via intrinsics: struct tuple { int x; int y; int z;};
int sumIt(tuple* input, long size, tuple* input2) { int sum = 0; for(size_t i = 0; i < size; i++){ sum += input2[input[i].x].y; __builtin_prefetch(&input2[input[i + 16].x]); } return sum;
} We hint at the CPU that we are soon going to access the value within 16 iterations. Note that this happens asychronously at the hardware level.

