Cache-line utilisation is defined as \(\frac{\text{data requested}}{\text{data loaded into cache}}\). We can increase utilisation by changing the data layout in memory. We can change the struct tuple from the previous example to hold three arrays: one for x, y and z. This means that all xs are next to each other (and ys and zs): struct tuple { int* x; int* y; int* z;};
int sumIt(tuple input, long size, tuple input2) { int sum = 0; for(size_t i = 0; i < size; i++) sum += input2.y[input.x[i]]; return sum;
} This optimisation is called Array-of-Structs to Struct-of-Arrays .
